/*Table structure for table `department` */

DROP TABLE IF EXISTS `department`;

CREATE TABLE `department` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键,ID',
  `name` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '科室名',
  `description` text COLLATE utf8_bin COMMENT '介绍',
  `url` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '图片链接',
  `delete_flag` tinyint(1) DEFAULT '0' COMMENT '逻辑删除标识 0 未删除，1 已删除, java中为 false/true',
  `created_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modified_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `created_user` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `modified_user` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='科室信息表';

