/*Table structure for table `register` */

DROP TABLE IF EXISTS `register`;

CREATE TABLE `register` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键,ID',
  `user_id` bigint(20) DEFAULT NULL COMMENT '挂号用户id',
